import React from 'react';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import { Menu, MenuItem } from '@material-ui/core';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';


const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },
    title: {
      flexGrow: 1,
    },
  }),
);

const ButtonAppBar = () => {
    const classes = useStyles();
    const [anchorEl, setAnchorEl] = React.useState<null | HTMLElement>(null);

    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        setAnchorEl(event.currentTarget);
  };

    const handleClose = () => {
      setAnchorEl(null);
    };
    const pushPage = (location: string) => {
        window.location(`/${location}`);
    }
  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu"></IconButton>
          <Typography variant="h6" className={classes.title}>
            News
          </Typography>
                  <Button color="inherit" onClick={handleClick}>Login</Button>
                  <Menu
                      id="simple-menu"
                      anchorEl={anchorEl}
        open={Boolean(anchorEl)}
      >
        <MenuItem onClick={handleClose("profile")}>Profile</MenuItem>
        <MenuItem onClick={handleClose("setting")}>My account</MenuItem>
        <MenuItem onClick={handleClose("logout")}>Logout</MenuItem>
      </Menu>
        </Toolbar>
      </AppBar>
    </div>
  );
}
export default ButtonAppBar;
